func BuyNFT(collectionID string, nftID string) {
	caller := std.GetOrigCaller()
	clt, ok := openocean.GetCollectionByID(collections, collectionID)
	coinSent := std.GetOrigSend()
	banker := std.GetBanker(std.BankerTypeOrigSend)
